B.a94=new A.am(B.ef,["Peste Porcine Africaine (PPA)","Aretina virus mahery vaika indrindra. Tsy misy fanafody na vaksiny. Mahafaty 100% ny kisoa.","\u2022 Fanaviana mafy (41-42\xb0C)\n\u2022 Mena ny hoditra (Oreilles, Ventre)\n\u2022 Mivalana r\xe0\n\u2022 Mandeha sarotra, kivy be\n\u2022 Maty tampoka","TSY MISY FANAFODY. Vonoy sy doroy ny kisoa marary rehetra.","Tsy misy.","\u2022 Ilazao avy hatrany ny V\xe9t\xe9rinaire\n\u2022 Atokana ny trano\n\u2022 Dorana ny faty (tsy alevina)\n\u2022 Fanadiovana tanteraka","\u2022 Biosecurity hentitra\n\u2022 Tsy omena sisan-tsakafo tsy nandrahoina\n\u2022 Fefy manodidina ny trano\n\u2022 Tsy ampidirina kisoa vaovao tsy quarantaine"],t.w)
B.a99=new A.am(B.ef,["Peste Porcine Classique (PPC)","Aretina virus mahery koa fa misy vaksiny. Miparitaka haingana.","\u2022 Fanaviana 40-41\xb0C\n\u2022 Mena ny hoditra\n\u2022 Mangovitra, tsy mahajoro\n\u2022 Mivalana, indraindray misy r\xe0\n\u2022 Maso mivonto","Tsy misy fanafody. Antibiotique hisorohana ny aretina hafa.","Tsy misy.","\u2022 Atokana ny marary\n\u2022 Ilazao ny V\xe9t\xe9rinaire","\u2022 Vaksiny PPC isaky ny 6 volana\n\u2022 Biosecurity"],t.w)
B.a98=new A.am(B.ef,["Rouget (Erysip\xe8le)","Aretina bakteria (Erysipelothrix). Mety ho mafy na mitaiza. Azo sitranina.","\u2022 Fanaviana mafy\n\u2022 Pentina diamant amin'ny hoditra (Carr\xe9s rouges)\n\u2022 Tsy te-hitsangana\n\u2022 Vonton'ny tonon-taolana (Arthrite)","\u2022 P\xe9nicilline (Tena mahomby)\n\u2022 Amoxicilline\n\u2022 Tsindrona intelo isan'andro, 3-5 andro","\u2022 Tongolo gasy (Fisorohana)\n\u2022 Fampangatsiahana ny vatana amin'ny rano matimaty","\u2022 Tsaboina avy hatrany\n\u2022 Atokana ny marary","\u2022 Vaksiny Rouget isaky ny 6 volana\n\u2022 Fahadiovana"],t.w)
B.a91=new A.am(B.ef,["Fivalanana (Diarrh\xe9e)","Aretina mahazatra amin'ny kisoa kely. Mety vokatry ny bakteria (E.coli, Salmonella) na virus.","\u2022 Mivalana ranony na fotsy\n\u2022 Marary kibo\n\u2022 Reraka, tsy homana\n\u2022 Mihena haingana ny lanja","\u2022 R\xe9hydratation (Rano + Sira + Siramamy)\n\u2022 Antibiotique (Colistine, Sulfamides)\n\u2022 Probiotique","\u2022 Rano nampangotrahina sy vary aron-tsira\n\u2022 Charbon de bois voatoto","\u2022 Omena rano matetika\n\u2022 Diovina ny trano\n\u2022 Hafanaina ny kisoa kely","\u2022 Fahadiovana\n\u2022 Hafanana (26-28\xb0C ho an'ny kely)\n\u2022 Tsindrona Fer J-3"],t.w)
B.a96=new A.am(B.ef,["Pneumonie (Aretitratra)","Fivontosana ny havokavoka, matetika vokatry ny hatsiaka na vovoka.","\u2022 Mikohaka, mikorina\n\u2022 Miaina mafy (Sempo)\n\u2022 Fanaviana\n\u2022 Tsy te-homana\n\u2022 Mitombo miadana","\u2022 Antibiotique (Tylosine, Florf\xe9nicol, Tilmicosine)\n\u2022 Anti-inflammatoire","\u2022 Tantely sy tongolo gasy\n\u2022 Inhalation: fampanehana etona kininina","\u2022 Hafanaina ny trano\n\u2022 Ahena ny vovoka","\u2022 Ventilation tsara (tsy miditra rivotra mivantana)\n\u2022 Tsy atao mifanizina loatra"],t.w)
B.a97=new A.am(B.ef,["Mange (Gale - Lagaly)","Aretina hoditra vokatry ny Sarcoptes (katsentsitra). Tena manelingelina ny kisoa.","\u2022 Mangidihidy mafy\n\u2022 Mihintsana ny volo\n\u2022 Hoditra matevina, misy kilema\n\u2022 Mikasokasoka hatrany\n\u2022 Mihena ny fitomboana","\u2022 Ivermectine (Tsindrona na Pour-on)\n\u2022 Averina afaka 14 andro","\u2022 Menaka coco sy soufre\n\u2022 Lavenona (Cendre) ahosotra","\u2022 Tsaboina ny kisoa rehetra miaraka\n\u2022 Diovina ny trano","\u2022 Ivermectine isan'3 volana\n\u2022 Fahadiovana"],t.w)
B.a9a=new A.am(B.ef,["Kankana (Parasites internes)","Katsentsitra anaty (Ascaris, Strongles) mihinana ny otrikaina. Tena mahazatra.","\u2022 Mahia nefa homana\n\u2022 Kibo be (indrindra ny kely)\n\u2022 Volo tsy manganohano\n\u2022 Mivalana, indraindray misy kankana","\u2022 Vermifuge (Ivermectine, L\xe9vamisole, Fenbendazole)\n\u2022 Averina isaky ny 2-3 volana","\u2022 Voan'ny Papay (maina sy totoina)\n\u2022 Voatavo (voany)","\u2022 Tsaboina ny rehetra\n\u2022 Diovina ny trano","\u2022 Vermifuge ara-potoana\n\u2022 Fanadiovana tsy tapaka"],t.w)
B.a92=new A.am(B.ef,["An\xe9mie (Hatsatra)","Tsy fahampian-dry (Fer) amin'ny kisoa vao teraka ka mahatonga hatsatra sy fahalemena.","\u2022 Hatsatra (P\xe2le) ny hoditra sy sofina\n\u2022 Reraka, tsy mazoto\n\u2022 Miaina mafy\n\u2022 Mitombo miadana","\u2022 Tsindrona Fer-Dextran 200mg (J-3)\n\u2022 Azo averina J-10 raha ilaina","\u2022 Tsy misy tena mahomby. Ny vy no ilaina.","\u2022 Tsaboina avy hatrany","\u2022 Tsindrona Fer isan-taranaka amin'ny J-3"],t.w)
B.a93=new A.am(B.ef,["Parvovirose (SMEDI)","Aretina virus manimba ny vohoka. Tsy misy soritra amin'ny reniny fa very ny zaza.","\u2022 Tsy miteraka (Infertilit\xe9)\n\u2022 Misitrika ny zaza (Momification)\n\u2022 Teraka kisoa maty\n\u2022 Zaza kely marefo","Tsy misy fanafody.","Tsy misy.","\u2022 Atokana ny marary\n\u2022 Andrasana 3 herinandro vao ampakarina indray","\u2022 Vaksiny Parvovirose alohan'ny fampakaram-bady voalohany\n\u2022 Rappel isan-taona"],t.w)
